import React, { useState } from "react";
import styles from "./Header.module.scss";

const Header = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  const closeMenu = () => {
    setIsOpen(false);
  };

  return (
    <div className={styles.burgerMenu}>
      <button className={styles.burgerIcon} onClick={toggleMenu}>
        {isOpen ? <CloseIcon closeMenu={closeMenu} /> : <BurgerIcon />}
      </button>
      {isOpen && (
        <div className={styles.menuOverlay}>
          <div className={styles.menuContent}>
            <MenuItem icon={<HomeIcon />} text="Home" />
            <MenuItem icon={<AboutIcon />} text="About" />
            <MenuItem icon={<ServicesIcon />} text="Services" />
          </div>
        </div>
      )}
    </div>
  );
};

const MenuItem = ({ icon, text }) => (
  <div className={styles.menuItem}>
    <div className={styles.menuListItem}>
      <span className={styles.menuItemIcon}>{icon}</span>
      <span className={styles.menuItemText}>{text}</span>
    </div>
  </div>
);

const BurgerIcon = () => (
  <svg
    className={styles.icon}
    viewBox="0 0 24 24"
    xmlns="http://www.w3.org/2000/svg"
  >
    <path d="M0 0h24v24H0z" fill="none" />
    <path d="M3 18h18v-2H3v2zm0-5h18v-2H3v2zm0-7v2h18V6H3z" />
  </svg>
);

const CloseIcon = ({ closeMenu }) => (
  <button className={styles.closeButton} onClick={closeMenu}>
    <svg
      className={styles.icon}
      viewBox="0 0 24 24"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path d="M0 0h24v24H0z" fill="none" />
      <path d="M19 6.41L17.59 5 12 10.59 6.41 5 5 6.41 10.59 12 5 17.59 6.41 19 12 13.41 17.59 19 19 17.59 13.41 12 19 6.41z" />
    </svg>
  </button>
);

const HomeIcon = () => (
  <svg
    className={styles.icon}
    viewBox="0 0 24 24"
    xmlns="http://www.w3.org/2000/svg"
  >
    <path fill="#999" d="M12 2L0 9l2 18h7V15h6v12h7L24 9l-12-7z" />
    <path fill="none" d="M0 0h24v24H0z" />
  </svg>
);

const AboutIcon = () => (
  <svg
    className={styles.icon}
    viewBox="0 0 24 24"
    xmlns="http://www.w3.org/2000/svg"
  >
    <path fill="#999" d="M12 2L0 9l2 18h7V15h6v12h7L24 9l-12-7z" />
    <path fill="none" d="M0 0h24v24H0z" />
  </svg>
);

const ServicesIcon = () => (
  <svg
    className={styles.icon}
    viewBox="0 0 24 24"
    xmlns="http://www.w3.org/2000/svg"
  >
    <path fill="#999" d="M12 2L0 9l2 18h7V15h6v12h7L24 9l-12-7z" />
    <path fill="none" d="M0 0h24v24H0z" />
  </svg>
);

export default Header;
